#   parseargs(argument_hashref, error_msgref)
sub parseargs(\%)
{
    my ($argument_hashref) = @_;
    my  $optcatchresult = 0;
    my  $help;
    my  $man;

    # wrap the signal handler for warnings to copy them to our message space
    local $SIG{__WARN__} = sub
                           {
                               error_msg_and_die("@_");
                           };

    # set defaults

    # parse @ARGV
    $optcatchresult = GetOptions(
        'stackssonly'           => \$argument_hashref->{stacksonly},
        'exteriorsonly'         => \$argument_hashref->{extonly},
        'bulgesonly'            => \$argument_hashref->{bulgeonly},
        'interiorsonly'         => \$argument_hashref->{intonly},
        'hairpinsonly'          => \$argument_hashref->{haironly},
        'multionly'             => \$argument_hashref->{multionly},
        'testsonly'             => \$argument_hashref->{testsonly},
        'verbose!'           => \$Verbose,
        'help'               => \$help,
        'man'                => \$man
                                );

    if ($optcatchresult == 0) { return 0 }

    if (defined($help)) { return 2 }

    if (defined($man)) { return 3 }

    # postprocess
    if (   $argument_hashref->{intonly}
        || $argument_hashref->{haironly}
        || $argument_hashref->{stacksonly}
        || $argument_hashref->{multionly}
        || $argument_hashref->{extonly}
        || $argument_hashref->{testsonly}
        || $argument_hashref->{bulgeonly})
    {
        $argument_hashref->{onlyopt} = 1;
    }

    return 1;
}

# progressbar_start
sub progressbar_start($ \%)
{
    my ($count, $pbar_hashref) = @_;

    if ($Verbose)
    {
        $pbar_hashref->{count} = $count;
        $pbar_hashref->{bar} = "";
        $pbar_hashref->{port} = 0;
        $pbar_hashref->{lw} = 47;

        # set up bar
        $pbar_hashref->{barrierbar} = ($count / ($pbar_hashref->{lw} - 1));
        $pbar_hashref->{nextbar} = $pbar_hashref->{barrierbar};
        $pbar_hashref->{stepbar} = (1 / $pbar_hashref->{barrierbar});

        # set up percentage counter
        $pbar_hashref->{barrierport} = ($count / 99);
        $pbar_hashref->{nextport} = $pbar_hashref->{barrierport};
        $pbar_hashref->{stepport} = (1 / $pbar_hashref->{barrierport});

        # set up time
        $pbar_hashref->{time} = time;
        $pbar_hashref->{tdiff} = 0;

        #print "\nCount: $pbar_hashref->{count}\n";
        #print "T(bar): $pbar_hashref->{barrierbar}\n";
        #print "T(port): $pbar_hashref->{barrierport}\n";
        #print "S(port): $pbar_hashref->{stepport}\n";

        printf("\n %3.0f%% [%s%*s ETA --:--:-- YY-MM-DD", $pbar_hashref->{port},
               $pbar_hashref->{bar},
               ($pbar_hashref->{lw} - length($pbar_hashref->{bar}) + 1), "]");
    }
}

# update_progressbar
sub progressbar_update($ \%)
{
    if ($Verbose)
    {
        my ($current, $pbar_hashref) = @_;
        my $need_rewrite = 0;

        if ($current > $pbar_hashref->{nextport})
        {
            $need_rewrite = 1;

            $pbar_hashref->{nextport} += $pbar_hashref->{barrierport};  
            $pbar_hashref->{port} = ($current * $pbar_hashref->{stepport});
        }
        if ($current > $pbar_hashref->{nextbar})
        {
            $need_rewrite = 1;

            $pbar_hashref->{bar} = sprintf("% *s",
                                           ($current * $pbar_hashref->{stepbar})
                                           , "");
            $pbar_hashref->{bar} =~ s/\s/=/g;
            $pbar_hashref->{nextbar} += $pbar_hashref->{barrierbar};
        }

        if ($need_rewrite)
        {
            $pbar_hashref->{tdiff} += (time - $pbar_hashref->{time});
            my $eta = (  (99 - $pbar_hashref->{port})
                       * $pbar_hashref->{tdiff})     /$pbar_hashref->{port};
            my ($sec,$min,$hour,$mday,$mon,$year,$wday,$yday,$isdst)
                = localtime(time + $eta);

            #print "$current $pbar_hashref->{nextbar}\n";
            printf("\r %3.0f%% [%s%*s ETA %02d:%02d:%02d %02d-%02d-%02d",
                   $pbar_hashref->{port},
                   $pbar_hashref->{bar},
                   ($pbar_hashref->{lw} - length($pbar_hashref->{bar}) + 1),
                   "]", $hour, $min, $sec, $year % 100,$mon + 1, $mday);

            $pbar_hashref->{time} = time;
        }
    }    
}

sub progressbar_finish(\%)
{
    if ($Verbose)
    {
        my ($pbar_hashref) = @_;

        $pbar_hashref->{tdiff} += (time - $pbar_hashref->{time});

        my $sec = $pbar_hashref->{tdiff} % 60;
        my $min = int(($pbar_hashref->{tdiff} % 3600) / 60);
        my $hou = int($pbar_hashref->{tdiff} / 3600);

        if ($hou > 100)
        {
            $hou = 99;
            $sec = 99;
            $min = 99;
        }

        $pbar_hashref->{bar} = sprintf("% *s", $pbar_hashref->{lw}, "");
        $pbar_hashref->{bar} =~ s/\s/=/g;
        printf("\r 100%% [%s] Elapsed time %02d:%02d:%02d\n",
               $pbar_hashref->{bar},
               $hou, $min, $sec);
    }    
}

# calc. no. of tests with stacking bp
sub calculate_tests_stacks(\%)
{
    my ($tests_hashref) = @_;
    my $b_per_test = 7;
    my $tests = (($NBPAIRS) * ($NBPAIRS));

    $tests_hashref->{tests} += $tests;
    $tests_hashref->{bases} += ($tests * $b_per_test);    
    $tests_hashref->{stacktests} = $tests;
}

# calc. no. of tests in testset
sub calculate_tests_testset(\%)
{
    my ($tests_hashref) = @_;
    my $tests = $#TESTSEQS + 1;

    $tests_hashref->{tests} += $tests;

    foreach (@TESTSEQS)
    {
        $tests_hashref->{bases} += (length($_)/2);  
    }  
    $tests_hashref->{testsettests} = $tests;
}

# calc. no. of tests for external loops
sub calculate_tests_extloops(\%)
{
    my ($tests_hashref) = @_;
    my $b_per_test = 10;
    my $tests = ($NBPAIRS * $NBASES);

    $tests *= 2;
    $tests_hashref->{tests} += $tests;
    $tests_hashref->{bases} += ($tests * $b_per_test);
    $tests_hashref->{extlooptests} = $tests;
}

# calc. no. of tests for multiloops
sub calculate_tests_multiloops(\%)
{
    my ($tests_hashref) = @_;
    my $cumtests = 0;
    my $tests;
    my ($i, $j);
    my $b_per_test = length("(...(...)...(...)...)");

    # test for penalty for non gc basepair initiating a stem
    $cumtests = $NBPAIRS;
    $tests_hashref->{bases} += ($b_per_test * $NBPAIRS); 

    # 5' + 3' dangle
    $tests = ($NBPAIRS * $NBASES);
    $tests *= 2;
    $cumtests += $tests;
    $tests_hashref->{bases} += ($tests * $b_per_test);    
    
    # linear multiloop energy
    for ($i = 1; $i < 10; $i++)
    {
        for ($j = 1; $j < 10; $j++)
        {
            $cumtests++;
            $tests_hashref->{bases} += (  $b_per_test
                                        + (length("(...)...") * $i) + $j);
        }
    }

    $tests_hashref->{tests} += $cumtests;
    $tests_hashref->{multilooptests} = $cumtests;
}

# calc. no. of tests for bulge loops
sub calculate_tests_bulgeloops(\%)
{
    my ($tests_hashref) = @_;
    my $b_per_test = 11;
    my $i;
    my $tests;
    my $cumtests = 0;

    # basic structure: ((...((...))))

    # 40 different loop sizes
    for ($i = 1; $i <= 40; $i++)
    {
        #$tests_hashref->{tests}++;
        $cumtests++;
        $tests_hashref->{bases} += ($b_per_test + $i);
    }

    # size 1 loop stacks
    $tests = ($NBPAIRS)*($NBPAIRS);
    #$tests_hashref->{tests} += $tests;
    $cumtests += $tests;
    $tests_hashref->{bases} += ($tests * ($b_per_test + 1));

    # bp in loops larger than 1
    $tests = ($NBPAIRS)*($NBPAIRS);
    #$tests_hashref->{tests} += $tests;
    $cumtests += $tests;
    $tests_hashref->{bases} += ($tests * ($b_per_test + 2));

    $tests_hashref->{tests} += $cumtests;
    $tests_hashref->{bulgetests} = $cumtests;
}

sub test_intloops(\%)
{
    my ($tests_hashref) = @_;
    my $tests = 0;
    my $bases = 0;
    my ($i, $j);
    my $seq;
    my ($o_bl, $o_br, $i_bl, $i_br);
    my ($b1, $b2, $b3, $b4);
    my ($lloop, $rloop, $struct);
    my ($lseq, $rseq);
    my %pbar;

    verbose_msg("  Testing internal loops...");

    progressbar_start($tests_hashref->{intlooptests}, %pbar);

    # 1x1 loops
    foreach (@BASEPAIRS)
    {
        ($o_bl, $o_br) = split(//,$_);
        foreach (@BASEPAIRS)
        {
            ($i_bl, $i_br) = split(//,$_);
            foreach (@BASES)
            {
                $b1 = $_;
                foreach (@BASES)
                {
                    $b2 = $_;
                    $seq = "$o_bl$b1${i_bl}aaa$i_br$b2$o_br";

                    cmp_G ($seq, "(.(...).)");

                    $tests++;
                    $bases += length($seq);
                    progressbar_update($tests, %pbar);
                }
            }            
        }
    }

    # 1x2 & 2x1 loops
    foreach (@BASEPAIRS)
    {
        ($o_bl, $o_br) = split(//,$_);
        foreach (@BASEPAIRS)
        {
            ($i_bl, $i_br) = split(//,$_);
            foreach (@BASES)
            {
                $b1 = $_;
                foreach (@BASES)
                {
                    $b2 = $_;
                    foreach (@BASES)
                    {
                        $b3 = $_;
                        $seq = "$o_bl$b1${i_bl}aaa$i_br$b2$b3$o_br";
                        
                        cmp_G ($seq, "(.(...)..)");
                        
                        $tests++;
                        $bases += length($seq);

                        $seq = "$o_bl$b1$b3${i_bl}aaa$i_br$b2$o_br";
                        
                        cmp_G ($seq, "(..(...).)");
                        
                        $tests++;
                        $bases += length($seq);
                        progressbar_update($tests, %pbar);
                   }
                }
            }            
        }
    }    

    # 2x2 loops
    foreach (@BASEPAIRS)
    {
        ($o_bl, $o_br) = split(//,$_);
        foreach (@BASEPAIRS)
        {
            ($i_bl, $i_br) = split(//,$_);
            foreach (@BASES)
            {
                $b1 = $_;
                foreach (@BASES)
                {
                    $b2 = $_;
                    foreach (@BASES)
                    {
                        $b3 = $_;

                        foreach (@BASES)
                        {
                            $b4 = $_;
                            $seq = "$o_bl$b1$b2${i_bl}aaa$i_br$b3$b4$o_br";
                            
                            cmp_G ($seq, "(..(...)..)");
                            
                            $tests++;
                            $bases += length($seq);
                            progressbar_update($tests, %pbar);
                        }
                    }
                }
            }            
        }
    }    

    # generic loops
    $lloop = "";
    $lseq = "";
    for ($i = 0; $i < 35; $i++)
    {
        $lloop .= ".";
        $lseq  .= "a";
        $rloop = "";
        $rseq = "";
        for ($j = 0; $j < 35; $j++)
        {
            $rloop .= ".";
            $rseq  .= "a";

            $struct = "($lloop(...)$rloop)";
            $seq    = "g${lseq}aaaau${rseq}c";

            cmp_G ($seq, $struct);

            $tests++;
            $bases += length($seq);
            progressbar_update($tests, %pbar);
        }
    }

    foreach (@BASEPAIRS)
    {
        ($o_bl, $o_br) = split(//,$_);
        foreach (@BASEPAIRS)
        {
            ($i_bl, $i_br) = split(//,$_);
            foreach (@BASES)
            {
                $b1 = $_;
                foreach (@BASES)
                {
                    $b2 = $_;
                    foreach (@BASES)
                    {
                        $b3 = $_;

                        foreach (@BASES)
                        {
                            $b4 = $_;
                            $seq ="$o_bl${b1}a$b2${i_bl}aaa$i_br${b3}a$b4$o_br";
                            
                            cmp_G ($seq, "(...(...)...)");
                            
                            $tests++;
                            $bases += length($seq);
                            progressbar_update($tests, %pbar);
                        }
                    }
                }
            }            
        }
    }    
    progressbar_finish(%pbar);

    verbose_msg ("                        tests finished: $tests\n");
    verbose_msg ("                        bases tested:   $bases\n");
    $tests_hashref->{tests} -= $tests;
    $tests_hashref->{bases} -= $bases;

    verbose_msg("  done.\n");
}

# test hairpin loops
sub test_hairpins(\%)
{
    my ($tests_hashref) = @_;
    my $tests = 0;
    my $bases = 0;
    my ($i);
    my ($bip1, $bjm1);
    my $loop;
    my $seq;
    my ($bi, $bj);
    my %pbar;

    verbose_msg("  Testing hairpin loops...");

    progressbar_start($tests_hashref->{hairpintests}, %pbar);

    # generic loops
    $loop = "..";
    $seq = "aa";
    for ($i = 1; $i < 34; $i++)
    {
        $loop .= ".";
        $seq  .= "a";

        cmp_G ("g${seq}c", "($loop)");

        $tests++;
        $bases += length("g${seq}c");
        progressbar_update($tests, %pbar);
    }

    # mimsatch penalty for loops of size 3 (bp)
    foreach (@BASEPAIRS)
    {
        ($bi, $bj) = split(//,$_);

        $seq = "${bi}aaa${bj}";

        cmp_G ($seq, "(...)");       

        $tests++;
        $bases += length($seq);
        progressbar_update($tests, %pbar);
    }

    # generic mismatch penalty (bp * b * b)
    foreach (@BASEPAIRS)
    {
        ($bi, $bj) = split(//,$_);

        foreach (@BASES)
        {
            $bip1 = $_;

            foreach (@BASES)
            {
                $bjm1 = $_;

                $seq = "${bi}${bip1}aaa${bjm1}${bj}";

                cmp_G ($seq, "(.....)");  

                $tests++;
                $bases += length($seq);
                progressbar_update($tests, %pbar);  
            }
        }
    }

    # tetraloops
    foreach (@BASES)
    {
        $bi = $_;

        foreach (@BASES)
        {
            $bip1 = $_;

            foreach (@BASES)
            {
                $bjm1 = $_;   

                foreach (@BASES)
                {
                    $bj = $_;

                    $seq = "g${bi}${bip1}${bjm1}${bj}c";

                    cmp_G ($seq, "(....)");  

                    $tests++;
                    $bases += length($seq);
                    progressbar_update($tests, %pbar);
                }
            }
        }
    }

    progressbar_finish(%pbar);

    verbose_msg ("                        tests finished: $tests\n");
    verbose_msg ("                        bases tested:   $bases\n");
    $tests_hashref->{tests} -= $tests;
    $tests_hashref->{bases} -= $bases;

    verbose_msg("  done.\n");
}

# calc. no. of tests for hairpin loops
sub calculate_tests_hairpins(\%)
{
    my ($tests_hashref) = @_;
    my $i;
    my $cumtests = 0;
    my $tests;

    # general loops, length 0 to 35
    for ($i = 1; $i < 34; $i++)
    {
        $cumtests++;
        $tests_hashref->{bases} += (length("(..)") + $i);
    }

    # mimsatch penalty for loops of size 3 (bp)
    $tests= $NBPAIRS;
    $cumtests += $tests;
    $tests_hashref->{bases} += (length("(...)") * $tests);

    # generic mismatch penalty (bp * b * b)
    for ($i = 0; $i < ($NBPAIRS * $NBASES * $NBASES); $i++)
    {
        $cumtests++;
        $tests_hashref->{bases} += (length("(.....)"));  
    }

    # tetraloops
    $tests= ($NBASES * $NBASES * $NBASES * $NBASES);    
    $cumtests += $tests;
    $tests_hashref->{bases} += (length("(....)") * $tests);    

    $tests_hashref->{tests} += $cumtests;
    $tests_hashref->{hairpintests} = $cumtests;
}

# calc. no. of tests for internal loops
sub calculate_tests_intloops(\%)
{
    my ($tests_hashref) = @_;
    my $b_per_test;
    my ($i, $j);
    my $tests;
    my $cumtests = 0;

    # 1x1 loops (.(...).)
    $tests = ($NBPAIRS) * ($NBPAIRS) 
           * ($NBASES) * ($NBASES);
    $cumtests += $tests;
    $tests_hashref->{bases} += ($tests * (length("(.(...).)")));

    # 1x2 loops (.(...)..)
    $tests *= ($NBASES);
    $cumtests += $tests;
    $tests_hashref->{bases} += ($tests * (length("(.(...)..)")));

    # 2x1 loops (.(...)..)
    $cumtests += $tests;
    $tests_hashref->{bases} += ($tests * (length("(..(...).)")));

    # 2x2 loops (..(...)..)
    $tests *= ($NBASES);
    $cumtests += $tests;
    $tests_hashref->{bases} += ($tests * (length("(..(...)..)")));

    # generic loops
    for ($i = 0; $i < 35; $i++)
    {
        for ($j = 0; $j < 35; $j++)
        {
            $cumtests++;
            $tests_hashref->{bases} += (length("(.(...).)") + $i + $j);
        }
    }
    $tests =  ($NBPAIRS)
            * ($NBPAIRS)
            * ($NBASES)
            * ($NBASES)
            * ($NBASES)
            * ($NBASES);
    $cumtests += $tests;
    $tests_hashref->{bases} += (length("(...(...)...)") * $tests);

    $tests_hashref->{tests} += $cumtests;
    $tests_hashref->{intlooptests} = $cumtests;
}

# calculate overall no. of tests
sub calculate_no_of_tests(\%)
{
    my ($arg_hashref) = @_;
    my %tests;
    
    $tests{tests} = 0;
    $tests{bases} = 0;

    if (! defined($arg_hashref->{onlyopt}))
    {
        calculate_tests_stacks(%tests);
        calculate_tests_extloops(%tests);
        calculate_tests_bulgeloops(%tests);
        calculate_tests_intloops(%tests);
        calculate_tests_hairpins(%tests);
        calculate_tests_multiloops(%tests);
        calculate_tests_testset(%tests);
    }
    else
    {
        if ($arg_hashref->{stacksonly})
        {
            calculate_tests_stacks(%tests);
        }
        if ($arg_hashref->{extonly})
        {
            calculate_tests_extloops(%tests);
        }
        if ($arg_hashref->{bulgeonly})
        {
            calculate_tests_bulgeloops(%tests);
        }
        if ($arg_hashref->{intonly})
        {
            calculate_tests_intloops(%tests);
        }
        if ($arg_hashref->{haironly})
        {
            calculate_tests_hairpins(%tests);
        }
        if ($arg_hashref->{multionly})
        {
            calculate_tests_multiloops(%tests);
        }
        if ($arg_hashref->{testsonly})
        {
            calculate_tests_testset(%tests);
        }
    }

    return %tests;
}

sub call_er2de ($ $)
{
    my ($seq, $struct) = @_;

    #print "$seq $struct\n";
    unless(open(FH, "../../../src/corb \"er2de $seq $struct\" |"))
    {
        error_msg_and_die ("Could not start er2de\n");
    }

    foreach (<FH>)
    {
        if ($_ =~ /G\s+=\s+(\-?\d+\.?\d*)/)
        {
            close(FH);
            return $1;
        }
    }

    close(FH);

    return 0;
}

sub call_rnaeval ($ $)
{
    my ($seq, $struct) = @_;

    #print "$seq $struct\n";
    unless(open(FH, "echo \"$seq\n$struct\" | ./RNAeval -d2 |"))
    {
        error_msg_and_die ("Could not start RNAeval\n");
    }

    foreach (<FH>)
    {
        if ($_ =~ /[\(\)\.]+\s+\(\s*(\-?\d+\.?\d*)\)/)
        {
            close(FH);
            return $1;
        }
    }

    close(FH);

    return 0;
}

sub cmp_G($ $)
{
    my ($seq, $struct) = @_;
    my $G_er2de = call_er2de($seq, $struct);
    my $G_rnaeval = call_rnaeval($seq, $struct);

    if ($G_er2de != $G_rnaeval)
    {
        error_msg_and_die ("Test of \"$seq\", "
                          ."\"$struct\" failed: G(er2de) = $G_er2de, "
                          ."G(RNAeval) = $G_rnaeval\n");
    }
    #else
    #{
    #    verbose_msg ("${struct} ${seq} ($G_er2de)  PASS\n");
    #}
}

# test multiloops
sub test_multiloops(\%)
{
    my ($tests_hashref) = @_;
    my $tests = 0;
    my $bases = 0;
    my ($bi, $bj);
    my ($i, $j);
    my $b;
    my $seq;
    my $close_seq;
    my $structure = "(...(...)...(...)...)";
    my $stretch;
    my $sstruct;
    my $close_struct;
    my %pbar;

    verbose_msg("  Testing multiloops...");

    progressbar_start($tests_hashref->{multilooptests}, %pbar);

    # test for penalty for non gc basepair initiating a stem
    foreach (@BASEPAIRS)
    {
        ($bi, $bj) = split(//,$_);

        $seq = "${bi}aaa${bj}aaa${bi}aaa${bi}aaa${bj}aaa${bj}";

        cmp_G ($seq, $structure);
        $tests++;
        $bases += length($seq);
        progressbar_update($tests, %pbar);        
    }

    # 5' + 3' dangle
    foreach (@BASEPAIRS)
    {
        ($bi, $bj) = split(//,$_);
        
        foreach (@BASES)
        {
            $b = $_;
            
            # 5'
            $seq = "gaa${b}${bi}aaa${bj}aa${b}${bj}aaa${bi}aa${b}c";
            cmp_G($seq, $structure);
            
            # 3'
            $seq = "gaaa${bi}aaa${bj}${b}aa${bj}aaa${bi}${b}aac";            
            cmp_G ($seq, $structure);

            $tests += 2;
            $bases += (2 * (length($seq)));
            progressbar_update($tests, %pbar); 
        }
    }


    # linear multiloop energy
    $structure = "(...(...)...(...)...";
    $close_struct = ")";
    $seq = "gaaaaaaauaaacaaagaaa";
    $close_seq = "c";
    for ($i = 1; $i < 10; $i++)
    {
        $close_struct = "(...)...".$close_struct;
        $close_seq = "gaaacaaa".$close_seq;

        $stretch = "";
        $sstruct = "";
        for ($j = 1; $j < 10; $j++)
        {
            $stretch .= "a";
            $sstruct .= ".";

            cmp_G ($seq.$stretch.$close_seq, $structure.$sstruct.$close_struct);

            $tests++;
            $bases += length($seq.$stretch.$close_seq);
            progressbar_update($tests, %pbar);
        }
    }


    progressbar_finish(%pbar);

    verbose_msg ("                        tests finished: $tests\n");
    verbose_msg ("                        bases tested:   $bases\n");
    $tests_hashref->{tests} -= $tests;
    $tests_hashref->{bases} -= $bases;

    verbose_msg("  done.\n");
}

# test stacking params
sub test_stacks(\%)
{
    my ($tests_hashref) = @_;
    my ($o_bl, $o_br, $i_bl, $i_br);
    my $structure = "((...))";
    my $tests = 0;
    my $bases = 0;
    my %pbar;

    verbose_msg("  Testing stacks...");

    progressbar_start($tests_hashref->{stacktests}, %pbar);
    foreach (@BASEPAIRS)
    {
        ($o_bl, $o_br) = split(//,$_);
        foreach (@BASEPAIRS)
        {
            ($i_bl, $i_br) = split(//,$_);

            cmp_G ("${o_bl}${i_bl}aaa${i_br}${o_br}", $structure);
            $tests++;
            $bases += length("${o_bl}${i_bl}aaa${i_br}${o_br}");
            progressbar_update($tests, %pbar);
        }
    }
    progressbar_finish(%pbar);

    verbose_msg ("                   tests finished: $tests\n");
    verbose_msg ("                   bases tested:   $bases\n");
    $tests_hashref->{tests} -= $tests;
    $tests_hashref->{bases} -= $bases;

    verbose_msg("  done.\n");
}

sub test_testset(\%)
{
    my ($tests_hashref) = @_;
    my $seq;
    my $structure;
    my $tests = 0;
    my $bases = 0;
    my %pbar;

    verbose_msg("  Testing test set samples...");
    progressbar_start($tests_hashref->{testsettests}, %pbar);

    # test stems
    foreach (@TESTSEQS)
    {
        $seq = substr($_, 0, length($_)/2);
        $structure = substr($_, length($seq));
        #print "$structure\n";
        
        cmp_G ($seq, $structure);
            
        $tests++;
        $bases += length($seq);

        progressbar_update($tests, %pbar);
    }
    progressbar_finish(%pbar);

    verbose_msg ("                          tests finished: $tests\n");
    verbose_msg ("                          bases tested:   $bases\n");
    $tests_hashref->{tests} -= $tests;
    $tests_hashref->{bases} -= $bases;

    verbose_msg("  done.\n");
}

sub test_extloops(\%)
{
    my ($tests_hashref) = @_;
    my ($bl, $br, $bd);
    my $structure5p = "...((...))";
    my $structure3p = "((...))...";
    my $tests = 0;
    my $bases = 0;
    my %pbar;

    verbose_msg("  Testing exterior loops...");
    progressbar_start($tests_hashref->{extlooptests}, %pbar);

    # test stems
    foreach (@BASEPAIRS)
    {
        ($bl, $br) = split(//,$_);

        foreach (@BASES)
        {
            $bd = $_;

            # 5'            
            cmp_G ("au${bd}${bl}caaag${br}", $structure5p);
            
            # 3'
            cmp_G ("${bl}caaag${br}${bd}ug", $structure3p);
            $tests += 2;
            $bases += 2 * (length("au${bd}${bl}caaag${br}"));

            progressbar_update($tests, %pbar);
        }
    }
    progressbar_finish(%pbar);

    verbose_msg ("                           tests finished: $tests\n");
    verbose_msg ("                           bases tested:   $bases\n");
    $tests_hashref->{tests} -= $tests;
    $tests_hashref->{bases} -= $bases;

    verbose_msg("  done.\n");
}

sub test_bulgeloops(\%)
{
    my ($tests_hashref) = @_;
    my $tests = 0;
    my $bases = 0;
    my $i;
    my $loop_seq = '';
    my $loop_struct = '';
    my $seq;
    my $struct;
    my ($o_bl, $o_br, $i_bl, $i_br);
    my %pbar;

    verbose_msg("  Testing bulge loops...");
    progressbar_start($tests_hashref->{bulgetests}, %pbar);

    # test diff. loop sizes
    for ($i = 1; $i <= 40; $i++)
    {
        $loop_seq .= "a";
        $loop_struct .= ".";

        $seq = "cg${loop_seq}cgaaacgcg";
        $struct = "(($loop_struct((...))))";

        cmp_G ($seq, $struct);       

        $tests++;
        $bases += length($seq);
        progressbar_update($tests, %pbar);
    }
    
    # test size 1 loops
    $struct = "((.((...))))";
    foreach (@BASEPAIRS)
    {
        ($o_bl, $o_br) = split(//,$_);
        foreach (@BASEPAIRS)
        {
            ($i_bl, $i_br) = split(//,$_);
            $seq = "c${o_bl}a${i_bl}gaaac${i_br}${o_br}g";

            cmp_G ($seq, $struct);       
            
            $tests++;
            $bases += length($seq);
            progressbar_update($tests, %pbar);
        }
    }

    # loops larger than 1
    $struct = "((..((...))))";
    foreach (@BASEPAIRS)
    {
        ($o_bl, $o_br) = split(//,$_);
        foreach (@BASEPAIRS)
        {
            ($i_bl, $i_br) = split(//,$_);
            $seq = "c${o_bl}aa${i_bl}gaaac${i_br}${o_br}g";

            cmp_G ($seq, $struct);       
            
            $tests++;
            $bases += length($seq);
            progressbar_update($tests, %pbar);
        }
    }
    progressbar_finish(%pbar);

    verbose_msg ("                        tests finished: $tests\n");
    verbose_msg ("                        bases tested:   $bases\n");
    $tests_hashref->{tests} -= $tests;
    $tests_hashref->{bases} -= $bases;

    verbose_msg("  done.\n");
}

